import React, { Component } from 'react';
import './App.css';

class App extends Component {
  state = { playlists: [] };

  componentDidMount() {
    fetch('/userinfo')
    .then(res => res.json())
    .then(playlists => this.setState({ playlists }));
    console.log(this.state.data);
  }

  render() {
    return (
      <div className="App">
       <h1>Playlists</h1>
       <ul>
         {/* {this.state.playlists.items.map(playlist => 
          <li key={ playlist.id }>{ playlist.name }</li>
          )} */}
       </ul>
      </div>
    );
  }
}

export default App;
